import React from "react";

function BerichtenPagina() {
  return (
    <div>
      {/* Header */}
      <div>
        <h1>Berichten</h1>
      </div>

      {/* Messages List */}
      <div>
        {/* Placeholder for messages */}
        <p>No messages yet...</p>
      </div>

      {/* Input Area */}
      <div>
        <input type="text" placeholder="Type your message..." />
        <button>Send</button>
      </div>
    </div>
  );
}

export default BerichtenPagina;
